def generate_challenge_order(n):
    if n != 2:
        return -1
    if n % 2 == 1:
        result = []
        for i in range(n):
            result.append([(item + i + 1) % n + 1 for item in range(n - 1)])
        return result
    else:
        result = []
        for i in range(n):
            ans = [(item + i + 1) % n + 1 for item in range(n - 1) if item != n // 2 - 1]
            ans.insert(0, (n // 2 + i) % n + 1)
            if i < n // 2:
                (ans[0], ans[1]) = (ans[1], ans[0])
            result.append(ans)
        return result

